import React, { useRef } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const SectionDivider = ({ variant = 'default' }) => {
  const ref = useRef(null);
  const [inViewRef, inView] = useInView({
    threshold: 0.1,
    triggerOnce: false,
  });

  const { scrollYProgress } = useScroll({
    target: ref,
    offset: ['start end', 'end start'],
  });

  const opacity = useTransform(scrollYProgress, [0, 0.5, 1], [0.3, 1, 0.3]);
  const scale = useTransform(scrollYProgress, [0, 0.5, 1], [0.8, 1, 0.8]);
  const y = useTransform(scrollYProgress, [0, 1], ['-20%', '20%']);

  const setRefs = (node) => {
    ref.current = node;
    inViewRef(node);
  };

  return (
    <div 
      ref={setRefs}
      className="relative w-full h-32 md:h-40 overflow-hidden"
    >
      {/* Animated Connecting Line */}
      <motion.div
        className="absolute inset-0 flex items-center justify-center"
        style={{ opacity, scale }}
      >
        <motion.div
          className="w-0.5 h-full bg-gradient-to-b from-transparent via-white/30 to-transparent origin-center"
          style={{ y }}
          animate={{
            scaleY: [0.5, 1, 0.5],
            opacity: [0.3, 0.8, 0.3],
          }}
          transition={{
            duration: 4,
            repeat: Infinity,
            ease: 'easeInOut',
          }}
        />
      </motion.div>

      {/* Animated Wave Pattern */}
      <motion.svg
        className="absolute inset-0 w-full h-full"
        viewBox="0 0 1200 200"
        preserveAspectRatio="none"
        style={{ opacity }}
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        viewport={{ once: false }}
        transition={{ duration: 1 }}
      >
        <motion.path
          d="M0,100 Q300,50 600,100 T1200,100 L1200,200 L0,200 Z"
          fill="rgba(255,255,255,0.03)"
          animate={{
            d: [
              'M0,100 Q300,50 600,100 T1200,100 L1200,200 L0,200 Z',
              'M0,100 Q300,150 600,100 T1200,100 L1200,200 L0,200 Z',
              'M0,100 Q300,50 600,100 T1200,100 L1200,200 L0,200 Z',
            ],
          }}
          transition={{
            duration: 8,
            repeat: Infinity,
            ease: 'easeInOut',
          }}
        />
      </motion.svg>

      {/* Flowing Particles */}
      {Array.from({ length: 6 }).map((_, i) => (
        <motion.div
          key={i}
          className="absolute w-2 h-2 bg-white/40 rounded-full blur-sm"
          style={{
            left: `${15 + i * 15}%`,
            top: '50%',
          }}
          animate={{
            y: ['-100%', '200%'],
            opacity: [0, 1, 0],
            scale: [0.5, 1.5, 0.5],
          }}
          transition={{
            duration: 3 + i * 0.5,
            repeat: Infinity,
            ease: 'easeInOut',
            delay: i * 0.4,
          }}
        />
      ))}

      {/* Central Connecting Dot */}
      <motion.div
        className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 w-4 h-4 bg-white/50 rounded-full blur-sm"
        style={{ opacity, scale }}
        animate={{
          scale: [1, 1.8, 1],
          opacity: [0.4, 0.8, 0.4],
        }}
        transition={{
          duration: 3,
          repeat: Infinity,
          ease: 'easeInOut',
        }}
      >
        <motion.div
          className="absolute inset-0 bg-white/30 rounded-full"
          animate={{
            scale: [1, 2, 1],
            opacity: [0.6, 0, 0.6],
          }}
          transition={{
            duration: 2,
            repeat: Infinity,
            ease: 'easeOut',
          }}
        />
      </motion.div>

      {/* Side Connecting Lines */}
      <motion.div
        className="absolute top-1/2 left-0 w-1/4 h-0.5 bg-gradient-to-r from-transparent to-white/20"
        style={{ opacity }}
        animate={{
          scaleX: [0.5, 1, 0.5],
          opacity: [0.2, 0.5, 0.2],
        }}
        transition={{
          duration: 4,
          repeat: Infinity,
          ease: 'easeInOut',
        }}
      />
      <motion.div
        className="absolute top-1/2 right-0 w-1/4 h-0.5 bg-gradient-to-l from-transparent to-white/20"
        style={{ opacity }}
        animate={{
          scaleX: [0.5, 1, 0.5],
          opacity: [0.2, 0.5, 0.2],
        }}
        transition={{
          duration: 4,
          repeat: Infinity,
          ease: 'easeInOut',
          delay: 0.5,
        }}
      />

      {/* Gradient Overlay for Smooth Transition */}
      <motion.div
        className="absolute inset-0 bg-gradient-to-b from-black/0 via-black/20 to-black/0 pointer-events-none"
        style={{ opacity }}
      />
    </div>
  );
};

export default SectionDivider;
